window.bookSummaryJSON = "<p>Humanity has avoided interstellar war for centuries. </p> <p>It was a time of peace, prosperity, and exploration. But when an unexpected attack cripples a scientific vessel, the SRES <i>Argo</i>, it appears that time has come to an end. </p> <p>Chief Medical Officer Tag Brewer is the ship's only survivor. He is alone in the far reaches of space. To survive, he must restore and protect the downed vessel from its unknown attackers on a planet as deadly as it is mysterious. He vows to do everything in his power to seek justice for his fallen crew. </p> <p>When Tag uncovers a sinister secret about those who attacked the <i>Argo</i>, he realizes far more is at stake than just his survival. Something more powerful, more technologically advanced, and more ruthless has emerged from the darkest voids of the galaxy. It's up to Tag to survive long enough to warn humanity and stop the dawn of a new war. </p>"; 
